onmessage = function(messageEvent) {
  Emojify.emojify(messageEvent.data.imageData, messageEvent.data.width, messageEvent.data.height);
}

var Emojify = (function() {

  // Entry point for emojify
  var emojify = function(imageData, width, height) {
    var lab, results;

    lab = convertImageToLab(imageData, width, height);
    results = findClosestEmojis(lab, width, height);
    postMessage({results: results, kind: "finished"});
  }

  var convertImageToLab = function (imageData, width, height) {
    var lab = [];
        counter = 0;

    // Drop it by a quarter of pixels.
    var i = 0,
        newRow = true;

    while (i < imageData.data.length) {

      if (!newRow && !(i%(width*4))) {
        i += 4 * 3 * width;
        newRow = true;
        continue;
      } 

      var pix = {r: imageData.data[i],
            g: imageData.data[i+1],
            b: imageData.data[i+2]};

      lab.push(ColorUtils.XYZtoLAB(ColorUtils.RGBtoXYZ(pix)));
    
      i += 16;
      newRow = false;
    }

    return lab;
  };

  var findClosestEmojis = function (image, width, height) {
    var results = [];

    for (var i = 0; i < width * height / 16; i++) {
      if (i%(width * height / (16 * 4))) postMessage({kind: "status", status: 100 * i/(width*height/16)});
      results.push(minEmoji(image[i]));
    }

    function minEmoji(lab) {
      var min = Number.MAX_VALUE,
          min_char;

      Object.keys(averages).forEach(function(val, i) {
        
        var distance = ColorUtils.colorDistance(averages[val], lab);
        
        if ( distance < min ) {
          min_char = val;
          min = distance;
        }

      });
      return min_char;

    }

    return results;
  };

  return {
    emojify: emojify
  }

})();